export default function Emma(){

    //state ou données

    const [personnes, setPersonnes] = useState([
            {id:1, nom:"DAVY"},
            {id:2, nom:"EMMA"},
            {id:3, nom:"NORAH"},
            {id:4, nom:"ORNAH"}
        ])

    //comportements



    //affichage
    return(
        <>
            <h3>liste de personne</h3>
            <ul>
                {personnes.map(personne=>{
                    return(
                        <li keys={personne.id}>{personne.nom}</li>
                    )
                })}
            </ul>
        </>
    )


}
